import React from 'react'
import {useSpring ,animated} from 'react-spring';

function App() {
  const one = useSpring({from:{color:"#a2a2a2"},color:"blue"})
  const two = useSpring({from:{transform:'translateX(0px)'},transform:'translateX(50px)'})
  const three = useSpring({from:{margin:"0"},margin:"60px"})
  return(
    <div>
    <animated.h1 style={one}>one</animated.h1>
    <animated.h1 style={two} >two</animated.h1>
    <animated.h1 >three</animated.h1>
  </div>
  )}



export default App
